def calculate_proximity_to_amenities_score(distance_to_public_transportation, distance_to_schools, distance_to_supermarkets, distance_to_hospitals, distance_to_parks):
    """"""
    weights = {'public_transportation': 0.3, 'schools': 0.2, 'supermarkets': 0.2, 'hospitals': 0.15, 'parks': 0.15}
    proximity_scores = {'public_transportation': 1 / (1 + distance_to_public_transportation), 'schools': 1 / (1 + distance_to_schools), 'supermarkets': 1 / (1 + distance_to_supermarkets), 'hospitals': 1 / (1 + distance_to_hospitals), 'parks': 1 / (1 + distance_to_parks)}
    proximity_to_amenities_score = sum((weights[amenity] * proximity_scores[amenity] for amenity in weights))
    return proximity_to_amenities_score
